import React from "react";
import { OverlayContainer, OverlayCloseIcon } from "./PokemonOverlayElements";
import closeIcon from "../../assets/images/closeIcon.png";
const PokemonOverlay = () => {
  return (
    <OverlayContainer>
      <OverlayCloseIcon src={closeIcon} />
      <OverlayContent>
        <OverlayHeads>
          <OverlayNumber>
            #798 <OverlayName>Xurtree</OverlayName>
          </OverlayNumber>
        </OverlayHeads>
      </OverlayContent>
    </OverlayContainer>
  );
};

export default PokemonOverlay;
